import { useState, useEffect } from "react";
function Register() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    password: "",
    firstName: "",
    lastName: "",
  });
  const { name, email, password, firstName, lastName } = formData;
  return <div></div>;
}

export default Register;
